import React, { useState } from 'react'
import PropTypes from 'prop-types'

const Alert = props => {
    const [sweet, setSweet] = useState();
    const sweetAlert = () => {
        console.log("Clicked")
    }
    return (
        <div>

            <button onClick={sweetAlert}>My sweet alert button</button>
        </div>
    )
}

Alert.propTypes = {

}

export default Alert
